<script>

    let points = d3.selectAll("circle")._groups[0]

    let minX = Number.MAX_VALUE
    let minY = Number.MAX_VALUE
    let maxX = Number.MIN_VALUE
    let maxY = Number.MIN_VALUE
    for(let i = 0; i < points.length; i ++){
        let cx = parseInt(points[i].attributes.cx.nodeValue)
        let cy = parseInt(points[i].attributes.cy.nodeValue)
        minX = Math.min(minX, cx)
        minY = Math.min(minY, cy)
        maxX = Math.max(maxX, cx)
        maxY = Math.max(maxY, cy)
    }

    minX -= 200
    minY -= 200
    maxX += 200
    maxY += 200


    console.log([minX, minY, maxX, maxY])

    var w = maxX - minX,
        h= maxY - minY,
        p= 50,
        x= d3.scaleLinear().domain([0, 1]).range([minX + p, maxX - p]),
        y= d3.scaleLinear().domain([0, 1]).range([maxY - p, minY + p]);

    console.log(x)

    var svg = d3.select("svg")

    for(let i = 0; i < 10; i += 2 ){
        svg.append("line")
            .attr("x1", x(i * 0.1))
            .attr("x2", x(i * 0.1))
            .attr("y1", minY + p)
            .attr("y2", maxY - p)
            .attr("stroke-width",1)
            .attr("stroke","#ccc")
    }

    for(let i = 0; i < 10; i ++){
        svg.append("line")
            .attr("y1", y(i * 0.1))
            .attr("y2", y(i * 0.1))
            .attr("x1", minX + p)
            .attr("x2", maxX - p)
            .attr("stroke-width",1)
            .attr("stroke"," #ccc")
    }

    d3.select("svg")
        .attr("viewBox",(minX)+" "+(minY)+" "+(maxX-minX)+" "+(maxY-minY))

</script>
